    if (props.tasks.length > 0){
        let key = 0;
        var taskContent = props.tasks.map((data) =>
        <TaskItem key={key += 1} taskTitle = {data.taskTitle} taskDetails = {data.taskDetails}></TaskItem>)
    }
    return (
        {}
    );
}

export default TaskList;
